import './chart.css'
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';


export default function Chart() {

    const data = [
        {
          name: 'Jan',
          "Active Users": 4000,
        },
        {
          name: 'Feb',
          "Active Users": 3000,
        },
        {
          name: 'Mar',
          "Active Users": 2000,
        },
        {
          name: 'April',
          "Active Users": 2780,
        },
        {
          name: 'May',
          "Active Users": 1890,
        },
        {
          name: 'Jun',
          "Active Users": 2390,
        },
        {
          name: 'Jul',
          "Active Users": 3490,
        },
        {
            name: 'Aug',
            "Active Users": 2190,
          },
          {
            name: 'Sep',
            "Active Users": 1490,
          },
           {
            name: 'Oct',
            "Active Users": 4490,
          },
          {
            name: 'Nov',
            "Active Users": 2490,
          },
          {
            name: 'Dec',
            "Active Users": 5000,
          },
      ];
    return (
        <div className='chart'>
            <h3 className="chartTitle">
                Travel Analytics
            </h3>

            <ResponsiveContainer width="100%" aspect={4/1}>
                <LineChart  data={data}>
                    <XAxis dataKey="name" stroke='#5550bd' />
                    <Line type="monotone" dataKey="Active Users"/>
                </LineChart>
                <Tooltip/>
            </ResponsiveContainer>

        </div>
    )
}
